// Output repo and version information
console.log('Powered by MoePlayer.\nPart Framework by LuckyStar.\nCopyright © ECat Plus Community.\nRepo: \nVersion: Development');

// Get the language preference of the user's device
const userLanguage = navigator.language;

// Set default language based on user device language
const defaultLanguage = userLanguage ? userLanguage : webLanguage;

// Initialization page language
changeLanguage(defaultLanguage);

// Modify language tag
document.documentElement.lang = defaultLanguage;

// Set logo
const siteLogo = 'data:image/png;base64,';

// Introduce default styles
loadCSSCode(".loading-container {position: fixed;top: 0;left: 0;width: 100%;height: 100%;display: flex;flex-direction: column;align-items: center;justify-content: center;background-color: #fff;}.loading-logo {width: 100px;height: 100px;}.loading-spinner {border: 4px solid rgba(255, 255, 255, 0.3);border-top: 4px solid #007bff;border-radius: 50%;width: 20px;height: 20px;animation: spin 2s linear infinite;}@keyframes spin {0% {transform: rotate(0deg);}100% {transform: rotate(360deg);}}");

// Creat favicon icon
var faviconLink = document.createElement('link');
faviconLink.setAttribute('rel', 'icon');
faviconLink.setAttribute('href', siteLogo);
document.head.appendChild(faviconLink);

// Output page
var content = document.getElementById("content");

// Before loading the loading page
var loadingContainer = document.createElement("div");
//loadingContainer.id="loading"
loadingContainer.classList.add('loading-container');
var loadingLogo = document.createElement("img");
loadingLogo.classList.add('loading-logo');
loadingLogo.src = siteLogo;
loadingLogo.alt = "LOGO";
var loadingText = document.createElement("p");
var loadingTextNode = document.createTextNode('MoePlayer');
loadingText.style.color = 'black';
loadingText.style.fontSize = '40px';
loadingText.appendChild(loadingTextNode);
loadingContainer.appendChild(loadingLogo);
loadingContainer.appendChild(loadingText);
content.appendChild(loadingContainer);

// Listen for requests
const urlParams = new URLSearchParams(window.location.search);
const cors_api = urlParams.get('cors');
const player = urlParams.get('player');
const playerLive = urlParams.get('live');
const playerAutoplay = urlParams.get('autoplay');
const playerTheme = urlParams.get('theme');
const playerLoop = urlParams.get('loop');
const playerScreenshot = urlParams.get('screenshot');
const playerHotkey = urlParams.get('hotkey');
const playerAirplay = urlParams.get('airplay');
const playerChromecast = urlParams.get('chromecast');
const playerPreload = urlParams.get('preload');
const playerVolume = urlParams.get('volume');
const playerLogo = urlParams.get('logo');
const playerPreventClickToggle = urlParams.get('preventClickToggle');
const playerType = urlParams.get('type');
const url = urlParams.get('url');
const pic = urlParams.get('pic');
const playerMutex = urlParams.get('playerMutex');
const playerMuted = urlParams.get('playerMuted');

window.onload = function () {
    // Remove Player logo
    loadingText.removeChild(loadingTextNode);

    // Modify the site logo
    loadingLogo.src = 'data:image/png;base64,';

    // Load static
    const hlsMinScript = staticCDNAddress + 'static/hls.js/1.5.4/hls.min.js';
    const dashAllMinScript = staticCDNAddress + 'static/dashjs/4.7.3/dash.all.min.js';
    const shakaPlayerCompiledScript = staticCDNAddress + 'static/shaka-player/4.7.9/shaka-player.compiled.js';
    const flvMinScript = staticCDNAddress + 'static/flv.js/1.6.2/flv.min.js';
    const webtorrentMinScript = staticCDNAddress + 'static/webtorrent/1.9.7/webtorrent.min.js';
    const dplayerScript = staticCDNAddress + 'static/dplayer/1.27.1/DPlayer.min.js';

    // Display prompts
    var loadingSpinner = document.createElement("div");
    loadingSpinner.classList.add('loading-spinner');

    if (player) {
        loadingContainer.appendChild(loadingSpinner);
        setTimeout(function () {
            content.removeChild(loadingContainer);

            content.style.backgroundColor = "black";
            content.style.backgroundSize = "cover";
            content.style.height = "100vh";
            content.style.position = "relative";
            content.style.boxSizing = "border-box";
            if (player == "dplayer") {
                // Create dplayer div
                var dplayer = document.createElement("div");
                dplayer.style.height = "100%";
                dplayer.style.width = "100%";
                content.appendChild(dplayer);

                // Init dplayer
                loadScript(hlsMinScript, function () {
                    loadScript(dashAllMinScript, function () {
                        loadScript(shakaPlayerCompiledScript, function () {
                            loadScript(flvMinScript, function () {
                                loadScript(dplayerScript, function () {
                                    window.dpFloat = new DPlayer({
                                        container: dplayer,
                                        live: playerLive,
                                        autoplay: playerAutoplay,
                                        theme: playerTheme,
                                        loop: playerLoop,
                                        lang: defaultLanguage,
                                        screenshot: playerScreenshot,
                                        hotkey: playerHotkey,
                                        airplay: playerAirplay,
                                        chromecast: playerChromecast,
                                        preload: playerPreload,
                                        volume: playerVolume,
                                        playbackSpeed: [0.1, 0.5, 0.75, 1, 1.25, 1.5, 2, 3, 5, 10],
                                        logo: playerLogo,
                                        preventClickToggle: playerPreventClickToggle,
                                        video: {
                                            type: playerType,
                                            url: (cors_api ? cors_api + url : url) || 'http://www.w3school.com.cn/example/html5/mov_bbb.mp4',
                                            pic: pic,
                                            thumbnails: pic,
                                        },
                                        mutex: playerMutex,
                                    });
                                });
                            });
                        });
                    });
                });
            } else {
                var videoPlayer = document.createElement("video");
                videoPlayer.controls = "controls";
                videoPlayer.style.height = "100%";
                videoPlayer.style.width = "100%";
                if (playerAutoplay) {
                    videoPlayer.autoplay = "autoplay";
                }
                if (playerLoop) {
                    videoPlayer.loop = "loop";
                }
                if (playerMuted) {
                    videoPlayer.muted = "muted";
                }
                if (pic) {
                    videoPlayer.poster = pic;
                }
                if (playerPreload) {
                    videoPlayer.preload = playerPreload;
                }
                if (url) {
                    videoPlayer.src = url;
                } else {
                    videoPlayer.src = 'http://www.w3school.com.cn/example/html5/mov_bbb.mp4';
                }
                videoPlayer.innerHTML = '<h1 style="color: white; text-align: center;">Your browser does not support the video tag.<br>Please use a newer version of your browser.</h1>';
                content.appendChild(videoPlayer);
            }
        }, 1500);
    } else {
        loadingText.innerHTML = "<br>The player you selected was not detected.<br>Please select a new player!";
        loadingText.style.color = 'red';
        loadingText.style.fontSize = '24px';
    }
};